/* eslint-disable no-trailing-spaces */
/* eslint-disable no-unused-vars */
import React from 'react'
import { motion } from 'framer-motion'

function Landing () {
  const variants = {
    visibleX: {
      x: 0,
      transition: {
        when: 'beforeChildren',
        // staggerChildren: 3,
        type: 'spring',
        damping: 15
      }
    },

    visibleY: {
      y: 0,
      transition: {
        delay: 2
      }
    }
  }
  return (
    <motion.div className='landingContainer'
      initial={{ x: -10000 }}
      variants={variants}
      animate='visibleX'
    >
      <motion.div className='landingTop'
        // initial={{ x: -1000 }}
        // variants={variants}
        // animate='visible'
      >
      </motion.div>

      <motion.div className='landingBottom'
        // initial={{ x: -1000 }}
        // variants={variants}
        // animate='visible'
      >
      </motion.div>

      <motion.div className='contentContainer'
        initial={{ y: -1000 }}
        variants={variants}
      >

      </motion.div>
    </motion.div>
  )
}

export default Landing
